import React from 'react';
import Message from '../Message/Message';
import './Dialog.css';

class Dialog extends React.Component {
    render() {
        let texts = ['hi', 'how are you', 'I am fine.\nAnd you?', "lets go to walk"];
        let messages = texts.map(txt => <Message text={txt}></Message>);
        return <div className="Dialog">
            <span>dialog</span>
            {messages}
            </div>;
    }
}

export default Dialog;
